import React from "react";

import classes from './'
import Button from './Button'
import { items } from "../UI/data/Items";


const Card = props => {
    console.log(items)

    return (
        <div>
            <div>
                <ul>
                    {items.map(items => {
                        return (
                            <li>
                                <div>
                                    <img src={items.imageURL}></img>
                                {items.name} 
                                {items.price} {items.Quantity}
                                </div>
                            </li>)
                    })
                    }
                </ul>
            </div>
            <Button />
        </div>
    )

};

export default Card;
